import{_ as t,c as n,o as r,a2 as i}from"./chunks/framework.D3KFGq5-.js";const h=JSON.parse('{"title":"Filterungs-Operatoren","description":"RxJS-Filterungs-Operatoren extrahieren nur die notwendigen Daten aus Streams basierend auf Bedingungen und Zeit. filter, take, skip, debounceTime, throttleTime, distinct, first, last und mehr - mit Auswahlrichtlinien nach Verwendungszweck und praktischen Anwendungsbeispielen.","frontmatter":{"description":"RxJS-Filterungs-Operatoren extrahieren nur die notwendigen Daten aus Streams basierend auf Bedingungen und Zeit. filter, take, skip, debounceTime, throttleTime, distinct, first, last und mehr - mit Auswahlrichtlinien nach Verwendungszweck und praktischen Anwendungsbeispielen."},"headers":[],"relativePath":"de/guide/operators/filtering/index.md","filePath":"de/guide/operators/filtering/index.md","lastUpdated":1765295683000}'),a={name:"de/guide/operators/filtering/index.md"};function l(d,e,s,g,u,f){return r(),n("div",null,[...e[0]||(e[0]=[i('<h1 id="filterungs-operatoren" tabindex="-1">Filterungs-Operatoren <a class="header-anchor" href="#filterungs-operatoren" aria-label="Permalink to &quot;Filterungs-Operatoren&quot;">​</a></h1><p>RxJS-Filterungs-Operatoren sind wichtige Werkzeuge, um nur die benötigten Daten aus einem Stream auszuwählen und unnötige Daten nicht durchzulassen. Dies verbessert die Effizienz und Leistung Ihrer Anwendung erheblich.</p><p>Filterungs-Operatoren sind eine Gruppe von RxJS-Operatoren, die Werte innerhalb eines Streams filtern und nur diejenigen durchlassen, die bestimmte Bedingungen erfüllen. Durch die Steuerung des Datenflusses und die Verarbeitung nur der notwendigen Werte können Sie effiziente Datenverarbeitungs-Pipelines aufbauen.</p><h2 id="operatorenliste" tabindex="-1">Operatorenliste <a class="header-anchor" href="#operatorenliste" aria-label="Permalink to &quot;Operatorenliste&quot;">​</a></h2><h3 id="◾-grundlegende-filterungs-operatoren" tabindex="-1">◾ Grundlegende Filterungs-Operatoren <a class="header-anchor" href="#◾-grundlegende-filterungs-operatoren" aria-label="Permalink to &quot;◾ Grundlegende Filterungs-Operatoren&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">Operator</th><th style="text-align:left;">Beschreibung</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="./filter">filter</a></td><td style="text-align:left;">Lässt nur Werte durch, die eine Bedingung erfüllen</td></tr><tr><td style="text-align:left;"><a href="./take">take</a></td><td style="text-align:left;">Nimmt nur die ersten angegebenen Werte</td></tr><tr><td style="text-align:left;"><a href="./takeLast">takeLast</a></td><td style="text-align:left;">Nimmt die letzten angegebenen Werte</td></tr><tr><td style="text-align:left;"><a href="./takeWhile">takeWhile</a></td><td style="text-align:left;">Nimmt Werte, solange eine Bedingung erfüllt ist</td></tr><tr><td style="text-align:left;"><a href="./skip">skip</a></td><td style="text-align:left;">Überspringt die ersten angegebenen Werte</td></tr><tr><td style="text-align:left;"><a href="./skipLast">skipLast</a></td><td style="text-align:left;">Überspringt die letzten angegebenen Werte</td></tr><tr><td style="text-align:left;"><a href="./skipWhile">skipWhile</a></td><td style="text-align:left;">Überspringt Werte, solange eine Bedingung erfüllt ist</td></tr><tr><td style="text-align:left;"><a href="./skipUntil">skipUntil</a></td><td style="text-align:left;">Überspringt Werte bis ein anderes Observable feuert</td></tr><tr><td style="text-align:left;"><a href="./first">first</a></td><td style="text-align:left;">Nimmt den ersten Wert oder den ersten Wert, der eine Bedingung erfüllt</td></tr><tr><td style="text-align:left;"><a href="./last">last</a></td><td style="text-align:left;">Nimmt den letzten Wert oder den letzten Wert, der eine Bedingung erfüllt</td></tr><tr><td style="text-align:left;"><a href="./elementAt">elementAt</a></td><td style="text-align:left;">Nimmt den Wert am angegebenen Index</td></tr><tr><td style="text-align:left;"><a href="./find">find</a></td><td style="text-align:left;">Findet den ersten Wert, der eine Bedingung erfüllt</td></tr><tr><td style="text-align:left;"><a href="./findIndex">findIndex</a></td><td style="text-align:left;">Nimmt den Index des ersten Wertes, der eine Bedingung erfüllt</td></tr><tr><td style="text-align:left;"><a href="./ignoreElements">ignoreElements</a></td><td style="text-align:left;">Ignoriert alle Werte und lässt nur Completion/Error durch</td></tr></tbody></table><h3 id="◾-zeitbasierte-filterungs-operatoren" tabindex="-1">◾ Zeitbasierte Filterungs-Operatoren <a class="header-anchor" href="#◾-zeitbasierte-filterungs-operatoren" aria-label="Permalink to &quot;◾ Zeitbasierte Filterungs-Operatoren&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">Operator</th><th style="text-align:left;">Beschreibung</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="./debounceTime">debounceTime</a></td><td style="text-align:left;">Gibt den letzten Wert aus, wenn für die angegebene Zeit keine Eingabe erfolgt</td></tr><tr><td style="text-align:left;"><a href="./throttleTime">throttleTime</a></td><td style="text-align:left;">Lässt den ersten Wert durch und ignoriert neue Werte für die angegebene Zeit</td></tr><tr><td style="text-align:left;"><a href="./auditTime">auditTime</a></td><td style="text-align:left;">Gibt den letzten Wert nach der angegebenen Zeit aus</td></tr><tr><td style="text-align:left;"><a href="./audit">audit</a></td><td style="text-align:left;">Steuert den Zeitraum mit einem benutzerdefinierten Observable und gibt den letzten Wert aus</td></tr><tr><td style="text-align:left;"><a href="./sampleTime">sampleTime</a></td><td style="text-align:left;">Samplet den neuesten Wert in bestimmten Zeitintervallen</td></tr></tbody></table><h3 id="◾-bedingungsbasierte-filterungs-operatoren" tabindex="-1">◾ Bedingungsbasierte Filterungs-Operatoren <a class="header-anchor" href="#◾-bedingungsbasierte-filterungs-operatoren" aria-label="Permalink to &quot;◾ Bedingungsbasierte Filterungs-Operatoren&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">Operator</th><th style="text-align:left;">Beschreibung</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="./distinct">distinct</a></td><td style="text-align:left;">Entfernt alle doppelten Werte (gibt nur eindeutige Werte aus)</td></tr><tr><td style="text-align:left;"><a href="./distinctUntilChanged">distinctUntilChanged</a></td><td style="text-align:left;">Entfernt aufeinanderfolgende doppelte Werte</td></tr><tr><td style="text-align:left;"><a href="./distinctUntilKeyChanged">distinctUntilKeyChanged</a></td><td style="text-align:left;">Erkennt nur Änderungen bestimmter Properties</td></tr></tbody></table><h2 id="praktische-anwendungsfalle" tabindex="-1">Praktische Anwendungsfälle <a class="header-anchor" href="#praktische-anwendungsfalle" aria-label="Permalink to &quot;Praktische Anwendungsfälle&quot;">​</a></h2><ul><li><a href="./practical-use-cases">Praktische Anwendungsfälle</a> stellt praktische Beispiele vor, die mehrere Filterungs-Operatoren kombinieren (Echtzeit-Suche, unendliches Scrollen usw.).</li></ul>',12)])])}const p=t(a,[["render",l]]);export{h as __pageData,p as default};
